import{_ as a,c as t,o as e,a as s}from"./app.6ddf011e.js";const u=JSON.parse('{"title":"新手教程","titleTemplate":"枪械","description":"","frontmatter":{"title":"新手教程","layout":"docs","titleTemplate":"枪械"},"headers":[{"level":2,"title":"介绍","slug":"介绍","link":"#介绍","children":[]},{"level":2,"title":"得到枪?","slug":"得到枪","link":"#得到枪","children":[{"level":3,"title":"在主城商店进行购买初级枪械包","slug":"在主城商店进行购买初级枪械包","link":"#在主城商店进行购买初级枪械包","children":[]},{"level":3,"title":"在主城与军火商人进行兑换","slug":"在主城与军火商人进行兑换","link":"#在主城与军火商人进行兑换","children":[]},{"level":3,"title":"在每时宝箱中进行随机抽取","slug":"在每时宝箱中进行随机抽取","link":"#在每时宝箱中进行随机抽取","children":[]},{"level":3,"title":"使用顶贴兑换券兑换","slug":"使用顶贴兑换券兑换","link":"#使用顶贴兑换券兑换","children":[]}]},{"level":2,"title":"得到配件？","slug":"得到配件","link":"#得到配件","children":[]},{"level":2,"title":"显示","slug":"显示","link":"#显示","children":[]},{"level":2,"title":"地图","slug":"地图","link":"#地图","children":[]}],"relativePath":"course/crackshot.md","lastUpdated":1672822993000}'),i={name:"course/crackshot.md"},r=s('<h2 id="介绍" tabindex="-1">介绍 <a class="header-anchor" href="#介绍" aria-hidden="true">#</a></h2><p>枪械是服务器的玩法之一，可以用到的领域也十分的广泛</p><p>在服务器中所有枪械均无需弹药</p><p>当你按下<strong>丢弃键</strong>即可装弹</p><p><img src="https://tangbao-1301296093.cos.ap-shanghai.myqcloud.com/xiye/docs/imag/crackshot/1.gif" alt="img"></p><p>当你将这一轮子弹打完后会自动装弹(如果没自动装弹请再点击一下<strong>放置键</strong>)</p><p>如果你子弹还剩下很多又懒得打光可以使用<strong>丢弃键</strong>进行装弹</p><p>服务器不仅有手枪还有步枪、狙等</p><p>下图是可以使用<strong>攻击键</strong>进行开镜的截图，基本上的狙都可以开镜</p><p><img src="https://tangbao-1301296093.cos.ap-shanghai.myqcloud.com/xiye/docs/imag/crackshot/2.png" alt="img"></p><h2 id="得到枪" tabindex="-1">得到枪? <a class="header-anchor" href="#得到枪" aria-hidden="true">#</a></h2><p>服务器现在<strong>较为主流</strong>的四种获得枪的方式有</p><h3 id="在主城商店进行购买初级枪械包" tabindex="-1">在主城商店进行购买初级枪械包 <a class="header-anchor" href="#在主城商店进行购买初级枪械包" aria-hidden="true">#</a></h3><p><img src="https://tangbao-1301296093.cos.ap-shanghai.myqcloud.com/xiye/docs/imag/crackshot/3.png" alt="img"></p><h3 id="在主城与军火商人进行兑换" tabindex="-1">在主城与军火商人进行兑换 <a class="header-anchor" href="#在主城与军火商人进行兑换" aria-hidden="true">#</a></h3><p><img src="https://tangbao-1301296093.cos.ap-shanghai.myqcloud.com/xiye/docs/imag/crackshot/4.png" alt="img"></p><h3 id="在每时宝箱中进行随机抽取" tabindex="-1">在每时宝箱中进行随机抽取 <a class="header-anchor" href="#在每时宝箱中进行随机抽取" aria-hidden="true">#</a></h3><p><img src="https://tangbao-1301296093.cos.ap-shanghai.myqcloud.com/xiye/docs/imag/crackshot/5.png" alt="img"></p><h3 id="使用顶贴兑换券兑换" tabindex="-1">使用顶贴兑换券兑换 <a class="header-anchor" href="#使用顶贴兑换券兑换" aria-hidden="true">#</a></h3><p><img src="https://tangbao-1301296093.cos.ap-shanghai.myqcloud.com/xiye/docs/imag/crackshot/6.png" alt="img"></p><h2 id="得到配件" tabindex="-1">得到配件？ <a class="header-anchor" href="#得到配件" aria-hidden="true">#</a></h2><p>你可以把配置当作附魔一样看待，好的配件可以给你的武器增加属性</p><p>配件你可以在主城的<strong>配件商人</strong>那里获取</p><p><img src="https://tangbao-1301296093.cos.ap-shanghai.myqcloud.com/xiye/docs/imag/crackshot/7.png" alt="img"></p><p>对于给枪械上配件就比作给武器上高级附魔一样操纵<strong>拖拽</strong></p><p>但是不是所有枪都可以上配件的！！</p><h2 id="显示" tabindex="-1">显示 <a class="header-anchor" href="#显示" aria-hidden="true">#</a></h2><p>对于一些玩家看到的枪和自己的枪是不一样的</p><p>那是因为你没装<strong>服务器专属材质包</strong></p><p><img src="https://tangbao-1301296093.cos.ap-shanghai.myqcloud.com/xiye/docs/imag/crackshot/8.png" alt="img"></p><h2 id="地图" tabindex="-1">地图 <a class="header-anchor" href="#地图" aria-hidden="true">#</a></h2><p><strong>对于枪战地图服务器有很多个,下面列出我已知的枪械地图</strong></p><p>足浴店的地下地图</p><p>/res tp csgo</p><p>/res tp r6</p>',35),c=[r];function o(n,h,l,p,d,g){return e(),t("div",null,c)}const _=a(i,[["render",o]]);export{u as __pageData,_ as default};
